import React from "react";
import { useState, useEffect } from "react";
import Leaguetable from "../components/Leaguetable";

const Lastmatcheng = () => {
  const [data, setData] = useState([]);
  const vals = Object.values(data);

  return (
    <>
      <div className="text-white shadow-xl absolute top-[150px] right-10 w-[400px] h-[774px] bg-white">
        <div className="w-full h-[15%] flex justify-center ">
          <h1 className="text-black text-2xl mt-4">Premier League 2022/2023</h1>
        </div>
        {data.length > 1 ? (
          ""
        ) : (
          <div className="w-full mt-[300px] flex justify-center items-center">
            <h1 className="text-black">Loading...</h1>{" "}
          </div>
        )}
        {data.length > 1 ? (
          <>
            {" "}
            <div className="flex justify-center w-full ">
              <div className="flex  w-[80%]  h-[60px] justify-between text-black">
                <h1>Pst</h1>
                <h1 className=" w-[120px]">Name</h1>
                <div className="flex w-[160px] justify-between ">
                  <h1 className="">Plyd</h1>
                  <h1>Lost</h1>

                  <h1>Won</h1>
                  <h1>Draw</h1>
                  <h1>Points</h1>
                </div>
              </div>
            </div>
            <div className="h-[80%] w-full  flex-row ">
              {vals.map((item) => {
                return (
                  <div className="flex m-auto w-[80%]  h-[30px] justify-between text-black">
                    <h1>{item.Position}</h1>
                    <h1 className="w-[120px]">{item.Name}</h1>
                    <h1>{item.Played}</h1>
                    <h1>{item.Loosed}</h1>
                    <h1>{item.Winned}</h1>
                    <h1>{item.Tie}</h1>
                    <h1>{item.Points}</h1>
                  </div>
                );
              })}
            </div>
          </>
        ) : (
          ""
        )}
      </div>
    </>
  );
};

export default Lastmatcheng;
